I have a list of strings, and I want to sort them in case-sensative way. For example, I have a list of strings: ["a", "A", "b", "B", "c", "C"] and I want to sort them in case-sensative way, so the result will be: ["A", "B", "C", "a", "b", "c"].
I tried to use sort() function, but it sorts them in case-insensitive way.
I tried to use sort() function, but it sorts them in case-insensitive way.
That's because sort() uses String.localeCompare() to compare strings. You can use a custom compare function to sort in case-sensitive way:
const list = ["a", "A", "b", "B", "c", "C"];
list.sort((a, b) => a.localeCompare(b, undefined, { sensitivity: 'case' }));
console.log(list);
["A", "B", "C", "a", "b", "c"]
